import { View, StyleSheet } from 'react-native';

import AppAlarm from '../../alarm/AppAlarm'


function AlarmScreen() {
    return (
      <View >
        <AppAlarm style={styles.container}></AppAlarm>
      </View>
    );
  }

  const styles = StyleSheet.create({
    container:{
      color:'red',
    },
  });
  
  
  export default AlarmScreen;
